Version: 2020.12.0+8.g3fb3d8c8 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1233","type":"BasicTickFormatter"},{"attributes":{},"id":"1267","type":"UnionRenderers"},{"attributes":{"overlay":{"id":"1250"}},"id":"1135","type":"BoxZoomTool"},{"attributes":{},"id":"1092","type":"ResetTool"},{"attributes":{},"id":"1231","type":"BasicTickFormatter"},{"attributes":{},"id":"1274","type":"Selection"},{"attributes":{"below":[{"id":"1190"}],"center":[{"id":"1193"},{"id":"1196"}],"left":[{"id":"1194"}],"name":"bandwidth_type_histogram","renderers":[{"id":"1201"}],"sizing_mode":"stretch_both","title":{"id":"1180"},"toolbar":{"id":"1197"},"toolbar_location":null,"x_range":{"id":"1182"},"x_scale":{"id":"1186"},"y_range":{"id":"1184"},"y_scale":{"id":"1188"}},"id":"bk-bandwidth-type-plot","subtype":"Figure","type":"Plot"},{"attributes":{"formatter":{"id":"1233"},"ticker":{"id":"1012"},"visible":false},"id":"1011","type":"LinearAxis"},{"attributes":{"overlay":{"id":"1093"}},"id":"1090","type":"BoxZoomTool"},{"attributes":{},"id":"1239","type":"BasicTickFormatter"},{"attributes":{"below":[{"id":"1158"}],"center":[{"id":"1160"},{"id":"1163"}],"left":[{"id":"1161"}],"name":"bandwidth_worker_heatmap","renderers":[{"id":"1168"}],"right":[{"id":"1170"}],"sizing_mode":"stretch_both","title":{"id":"1148"},"toolbar":{"id":"1164"},"toolbar_location":null,"x_range":{"id":"1150"},"x_scale":{"id":"1154"},"y_range":{"id":"1152"},"y_scale":{"id":"1156"}},"id":"bk-bandwidth-worker-plot","subtype":"Figure","type":"Plot"},{"attributes":{"active
